/** Uses the NodeAccessInfo of pOther and its children. */
void PerStreamPriorityTypeBase::useAccessInfoFromInstance(PerStreamPriorityTypeBase *pOther)
{
    OpcUa::BaseObjectType::useAccessInfoFromInstance(pOther);

    // children
    m_pVlanTag->useAccessInfoFromInstance(pOther->m_pVlanTag);
    if (m_pEtherType && pOther->m_pEtherType)
    {
        m_pEtherType->useAccessInfoFromInstance(pOther->m_pEtherType);
    }
    m_pPerStreamPriorityMode->useAccessInfoFromInstance(pOther->m_pPerStreamPriorityMode);
    if (m_pSubtype && pOther->m_pSubtype)
    {
        m_pSubtype->useAccessInfoFromInstance(pOther->m_pSubtype);
    }
    if (m_pSubtypeEnable && pOther->m_pSubtypeEnable)
    {
        m_pSubtypeEnable->useAccessInfoFromInstance(pOther->m_pSubtypeEnable);
    }
    if (m_pTCPPort && pOther->m_pTCPPort)
    {
        m_pTCPPort->useAccessInfoFromInstance(pOther->m_pTCPPort);
    }
    if (m_pUDPPort && pOther->m_pUDPPort)
    {
        m_pUDPPort->useAccessInfoFromInstance(pOther->m_pUDPPort);
    }
    m_pSetPerStreamPriorityMethod->useAccessInfoFrom(pOther->m_pSetPerStreamPriorityMethod);
}

